import React, { Component } from 'react'
import axios from 'axios'

import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';

export default class Weather extends Component {

    //Define state default values
    state = {
        persons: []
    };

     //Component Lifecycle Callback
    componentDidMount() {
        axios.get(`https://randomuser.me/api/?results=10`)
        .then(res => {
            console.log(res.data);
            const persons = res.data.results;
            this.setState({ persons });
        })
    }


    render() {
        return (
            <Container className="container-fluid">

                <h1 className="btn-success text-center">User List</h1>

                {this.state.persons.map (person =>
                        <div className="col-lg-auto btn-info">
                            <b>{person.name.title} {person.name.first}
                                {person.name.last} {person.login.uuid}</b>
                            <div className="row m-2">
                                <div className="col-sm-4 text-center p-5">
                                <img className="badge-pill" src ={person.picture.large} /><br/><br/>
                                <Button className="bg-primary" type="submit">Details</Button>
                                </div>
                                <div className="col-sm-8">
                                <p>User Name: {person.login.username}</p>
                                <p>Gender: {person.gender}</p>
                                <p>Time Zone Description: {person.location.timezone.description}</p>
                                <p>Address: {person.location.street.number} {person.location.street.name},
                                    {person.location.city}, {person.location.state},
                                    {person.location.country} - {person.location.postcode}</p>
                                <p>Email: {person.email}</p>
                                <p>Birth Date and Age: {person.dob.date} ({person.dob.age})</p>
                                <p>Register Date: {person.registered.date}</p>
                                <p>Phone#: {person.phone}</p>
                                <p>Cell#: {person.cell}</p>
                                </div>
                            </div>
                        </div>
                    )}
            </Container>
        )
    }

}
